import React from 'react';
import logo from '../../assests/images/logo.png';
import {Styles} from './Header.Style';

export default function Header() {
    return (
        <div><nav className="navbar navbar-light bg-white">
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-12">
                    <a className="navbar-brand" href="#"><img src={logo} alt="" width="38px" height="47.5px"  /></a>
                    <span style={Styles.logoFont}>TheBox</span>
                        
                    </div>
                    
                </div>
                
            </div>
        </nav>

        </div>
    )
}
